import React from 'react';
import Header from './Header';
import Main from './Main';
import Map from './Map';
import axios from 'axios';
export default function DashBoard(props)
{   // --- Generare vector cu id-urile spot-urilor favorite :
    const api = axios.create({
      baseURL: `https://627e1ec9b75a25d3f3b21451.mockapi.io`});
  
    const [favourites,setFavourites] = React.useState([])
     React.useEffect(()=>{
    const fetch = async () =>{
         try{
             const response = await api.get('/favourites')
          setFavourites(response.data.filter(user => user.userName == props.name))
      } catch(err){
           if(err.response){
               console.log(err.response.data)
               console.log(err.response.status)
               console.log(err.response.header)
          }
          else {
               console.log(`Error: ${err.message}`)
          }
      }
      }
      fetch();
       },[])
     console.log(favourites)
  // ---------------------------------------------------------
    return(
        <div className="DashBoard">
            <Header Logout={props.Logout}/>
            <Main userFavourites={favourites} name={props.name}/>
        </div>
    )
}
